    const dispatch = useDispatch();
    const auth = useSelector(state=>state.auth);
    const post = useSelector(state=>state.post);

    useEffect(() => {
        console.log(props)

        dispatch(getPosts(auth.token));
    }, [])


    return (
        <Card width='100%' height='10%'  >
            <RoundWrapper>
                {props && <div>{props}</div>}
            </RoundWrapper>
        </Card>
    )
}

